import React from "react";
import {
    Button,
    Container,
    Divider,
    Paper,
    TextField,
    Typography,
} from "@mui/material";
import { Box, Stack } from "@mui/system";
import { Add, Search } from "@mui/icons-material";

function ClientesBusqueda() {
    const boxStyle = {
        sx: {
            width: "100vw",
            minHeight: "100vh",
            height: "100%",
            backgroundColor: "#dbdbdb",
            m: 0,
            p: 0,
        },
    };

    const paperStyle = {
        sx: {
            width: "100%",
            minWidth:'250px',
            // p:2
            
        },
    };

    const inputsStackStyle = {
        sx: { width: "25%", minWidth:'200px', mr:2},
    };

    
    const newButtonStyle = {
        color:"success",
        // sx:{backgroundColor:'green'}
    }
    
    const searchButtonStyle = {
        color : "secundary",
        variant: "outlined",
        sx:{}
    }
    

    return (
        // <Container fixed>
        <Box {...boxStyle}>
            <Container >
                <Stack
                    direction={"row"}
                    justifyContent="space-between"
                >
                    <Typography variant="h6">Personas</Typography>
                    <Button {...newButtonStyle}variant="filled">
                        <Add />
                        Nuevo
                    </Button>
                </Stack>
                <Paper {...paperStyle}>
                <Box sx={{p:1}}>
                    <Typography variant={"h6"}>Filtros</Typography>
                    <Divider />
                    <Stack flexDirection={{xs:"column", sm:'row'}} sx={{mt:2}}>
                        <Stack {...inputsStackStyle}>
                            <Typography variant={"body2"}>Nombre</Typography>
                            <TextField></TextField>
                        </Stack>
                        <Stack {...inputsStackStyle}>
                            <Typography variant={"body2"}>
                                Tipo documento
                            </Typography>
                            <TextField></TextField>
                        </Stack>
                    </Stack>
                    <Stack direction={"row"} justifyContent={'flex-end'}>
                        <Button {...searchButtonStyle} color='primary' ><Search/>Buscar</Button>
                    </Stack>
                    </Box>
                </Paper>
            </Container>
        </Box>
        // </Container>
    );
}

export default ClientesBusqueda;
